import React from 'react';

const AboutMeCard = () => {
    return (
        <div id='about-me-card' className='br3 pa3 ma2 bw2 shadow-5'>
            <h3>Who am I?</h3>
            <p>I am a 'junior' <a href='https://dictionary.cambridge.org/dictionary/english/polymath' rel='noopener noreferrer' target='_blank'>polymath</a>, but I still have much to learn.</p>
            <p>I am a Physiologist. I am a Web Developer. I am a Teacher. I am a sports & exercise fanatic.</p>
            <p>My personality assessment suggests that I am heavily concerned with 'people mastery'.</p>
            <p>I love everything about the natural world.</p>
            <p>I am fascinated by everything about the 'unnatural', human world.</p>
            <p>I believe that doing good brings happiness, and I strive for both.</p>
            <p>I made this website.</p>
            <p>I hope you like it.</p>
        </div>
    )
}

class AboutMe extends React.Component {
    render() {
        return (
            <div className='flex flex-column items-center'>
                <AboutMeCard />
            </div>
        )
    }
}

export default AboutMe;
